import React, { useContext, useEffect } from 'react'
import { useParams } from 'react-router-dom'
import { ProductContext } from '../../Pages/Products/productProvider'
import NoDataMessege from './NodataFound/NoDataMessege'
import Product from './Product'
import InputForm from './SearchBar/InputForm'

const Products = () => {
    const context = useContext(ProductContext)
    const params = useParams()
    const { selectedProducts } = context.state.productData;
    console.log('selectedProducts', selectedProducts);
    useEffect(() => {
        context.dispatch({ type: params.type })
    }, [params.type])
    return (
        <div className='col-9'>
            <InputForm dispatch={context.dispatch} />
            <div className='row'>
                {selectedProducts ? selectedProducts.map(data => {
                    return <Product key={data.id} data={data} />
                }) : <NoDataMessege/>}
            </div>
                {!selectedProducts ? <h2>yes</h2> : <h2>no</h2>}
        </div>
    )
}
export default Products
